  `concrete_type` varchar(12) DEFAULT NULL COMMENT '具体类型： 请假的具体类型及饮酒的具体类型',
  `bbr` varchar(128) DEFAULT NULL COMMENT '报备人',
  `address` varchar(128) DEFAULT NULL COMMENT '地点',
  `start_date` datetime DEFAULT NULL COMMENT '开始时间',
  `end_date` datetime DEFAULT NULL COMMENT '结束时间',
  `bb_days` int(11) DEFAULT NULL COMMENT '报备天数',
  `dd_view` varchar(12) DEFAULT NULL COMMENT '大队可视权限：0 or null 无； 1 有',
  `dd_lc` varchar(12) DEFAULT NULL COMMENT '大队操作权限：0 or null 无； 1 有',
  `jg_view` varchar(12) DEFAULT NULL COMMENT '机关部门长可视权限：0 or null 无； 1 有',
  `jg_lc` varchar(12) DEFAULT NULL COMMENT '机关部门长操作权限：0 or null 无； 1 有',
  `zzc_view` varchar(12) DEFAULT NULL COMMENT '政治处主任可视权限：全权限',
  `zzc_lc` varchar(12) DEFAULT NULL COMMENT '政治处主任操作权限：0 or null 无； 1 有',
  `zg_view` varchar(12) DEFAULT NULL COMMENT '支队主官可视权限：全权限',
  `zg_lc` varchar(12) DEFAULT NULL COMMENT '支队主官操作权限：0 or null 无； 1 有',
  `end_flag` varchar(12) DEFAULT NULL COMMENT '结束标记：1 结束； 0 or null 未结束(到期或销假）',
  `xj_flag` varchar(12) DEFAULT NULL COMMENT '提前销假标记： 1 销假',
  `sh_end_flag` varchar(12) DEFAULT NULL COMMENT '审核结束标记： 1 审核流程结束',
  `rec_date` datetime DEFAULT NULL,
  `info_remark` varchar(128) DEFAULT NULL,
  `xj_date` datetime DEFAULT NULL,
  `cp_num` varchar(128) DEFAULT NULL,
  `zd_view` varchar(128) DEFAULT NULL,
  `zd_cl` varchar(128) DEFAULT NULL,
  `jwk_view` int(11) DEFAULT NULL,
  `jwk_lc` int(11) DEFAULT NULL,
  `cmz_view` int(11) DEFAULT NULL,
  `cmz_lc` int(11) DEFAULT NULL,
  `jj_lxr_name` varchar(128) DEFAULT NULL,
  `jj_lxr_phone` varchar(128) DEFAULT NULL,
  `lc_num` varchar(128) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

